import React, { useState, useEffect } from "react";
import Sidebar from "../../pages/templates/sidebar";
import Header from "../../pages/templates/header";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { Link } from "react-router-dom";

const User = () => {
  const navigate = useNavigate();
  const handleBack = () => {
    navigate(-1);
  };

  // modal delete
  const [isDeleteOpen, setIsDeleteOpen] = useState(false);
  // penyimpanan sementara id delete
  const [deleteUserId, setDeleteUserId] = useState();
  // page register pasien
  const [isRegisterPasienRanap, setIsRegisterPasienRanap] = useState(false);
  // search bar
  const [searchQuery, setSearchQuery] = useState("");
  const [searchResult, setSearchResult] = useState([]);
  const [tampilanSearch, setTampilanSearch] = useState(false);
  // penyimpanan data sesuai yang dipilih pada saat search di kolom search register
  const [datausers, setDataUsers] = useState([]);
  // post data register
  const [formData, setFormData] = useState({});
  const [simpanid, setSimpanId] = useState();

  // pagination
  const [page, setPage] = useState(1);
  const [limit, setLimit] = useState(10);
  const [totalPages, setTotalPages] = useState();

  // retrive all pasien ranap
  const [allUsers, setAllUsers] = useState([]);
  // kolom pencarian pasien ranap
  const [searchQueryUsers, setSearchQueryUsers] = useState("");
  const [selectJabatan, setSelectJabatan] = useState("");
  const [selectStatus, setSelectStatus] = useState("");

  //  //livesearch
  // useEffect(() => {
  //   if (searchQuery !== "") {
  //     fetch(`${API_URL}/igd/pasien?search=${searchQuery}&page=&limit=5`)
  //       .then((response) => response.json())
  //       .then((data) => setSearchResult(data.data))
  //       .catch((error) => console.error(error));
  //   } else {
  //     setSearchResult([]);
  //   }
  // }, [searchQuery]);

  //all users
  useEffect(() => {
    const fetchAllDataUsers = async () => {
      try {
        if (searchQueryUsers !== "") {
          const response = await axios.get(
            `${API_URL}/users/all?search=${searchQueryUsers}&jabatan=${selectJabatan}&status=${selectStatus}&page=1&limit=${limit}`
          );
          setAllUsers(response.data.data);
          setTotalPages(response.data.totalPages);
        } else {
          const response = await axios.get(
            `${API_URL}/ranap/pasien/all?search=${searchQueryUsers}&jabatan=${selectJabatan}&status=${selectStatus}&page=${page}&limit=${limit}`
          );
          setAllUsers(response.data.data);
          setTotalPages(response.data.totalPages);
        }
      } catch (error) {
        console.log(error);
      }
    };

    fetchAllDataUsers();
  }, [searchQueryUsers, page, setAllUsers, limit]);

  return (
    <div class="h-full">
      <div class="flex">
        <div class="flex-none">
          <Sidebar />
        </div>
        <div class="flex-auto bg-dasar border-l-2 border-opacity-30 border-gray-300 shadow-md">
          <Header />

          <div class="container mx-auto 2xl:w-screen px-8 pb-10">
            <div className="container border border-state-300 bg-white p-5 mt-5 mb-4 ">
              <div className="search text-left flex">
                <div className="search text-left flex ">
                  <form>
                    <input
                      //   onChange={handleSearchPasienRanapChange}
                      //   value={searchQueryPasienRanap}
                      className="border border-black pl-0.5 py-0.4  "
                      type="text"
                      placeholder="Cari pasien rawat inap..."
                    />
                  </form>
                </div>
                <div className="container mx-auto w-full flex justify-end ">
                  <button
                    // onClick={() => setPage((page) => page - 1)}
                    // hidden={page === 1}
                    type="button"
                    class="bg-white text-state-400 rounded-l-md border border-black border-l  mr-1"
                  >
                    <div class="flex flex-row align-middle">
                      <svg
                        class="w-4 mr-1 mt-0.5"
                        fill="currentColor"
                        viewBox="0 0 20 20"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M7.707 14.707a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 1.414L5.414 9H17a1 1 0 110 2H5.414l2.293 2.293a1 1 0 010 1.414z"
                          clip-rule="evenodd"
                        ></path>
                      </svg>
                      <p class="ml-0.5 mr-1 text-sm">Prev</p>
                    </div>
                  </button>

                  <button
                    // onClick={() => {
                    //   setPage((page) => page + 1);
                    // }}
                    // hidden={page === totalPages}
                    type="button"
                    class="bg-white text-state-400 border border-black rounded-r-md border-l "
                  >
                    <div class="flex flex-row align-middle">
                      <p class="mr-0.5 ml-0.5 text-sm">Next</p>
                      <svg
                        class="w-4 mr-1 mt-0.5"
                        fill="currentColor"
                        viewBox="0 0 20 20"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M12.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L14.586 11H3a1 1 0 110-2h11.586l-2.293-2.293a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        ></path>
                      </svg>
                    </div>
                  </button>
                </div>
              </div>
              <div class="overflow-x-auto mb-5 ">
                <div className="container bg-emerald300 text-left pl-2 mt-3 py-0.5">
                  List Penjualan
                </div>
                <div className="overflow-y-auto max-h-[48vh]"></div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default User;
